import Vue from 'vue'
import App from './App.vue'
import VueRouter from 'vue-router'
Vue.use(VueRouter)//插件初始化
const router = new VueRouter({
  //路由路线们，配置path路径与component：切换的组件
  routes: [
    { path: '/find', component: Find }
  ]
})

Vue.config.productionTip = false

Vue.directive('focus', {
  inserted(el) {
    el.focus()
  }
})
new Vue({
  render: h => h(App),
  router
}).$mount('#app')
